import React from 'react'
import Wheel from '../Wheel/Wheel'
import BasicMap from '../BasicMap/BasicMap'

export default class Demo extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            metric: 'pop'
        }
    }
    render(){
        return (
            <div>
                <h1>Hello world!</h1>
                <button onClick={() => this.setState({metric: "gdp"})}>Show GDP</button>
                <button onClick={() => this.setState({metric: "pop"})}>Show Population</button>
                <BasicMap metric={this.state.metric}/>
            </div>
        )
    }
}
